import './Landing.css';
import React from 'react';
import SimpleAppBar from './components/SimpleAppBar';

const drawerWidth = 240;
const navItems = ['Contact', 'Links', 'Resume'];

function Landing() {
    return (
      <React.Fragment>
        <SimpleAppBar />
        <div className="Landing">
            <p>
              E
            </p>
        </div>
        <div>
            <p>
              Contact
            </p>
        </div>
      </React.Fragment>
    );
  }
  
  export default Landing;
